import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import Search from './pages/Search';

function App() {
  return (
    <Router>
      <div className='app'>
        <Navbar />
        <div className='content'>
          <switch>
            <route path='/'>
              <Home />
            </route>
            <route path='/search'>
              <Search />
            </route>
          </switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
